import React, { useState } from 'react';

const App = () =>{
    const [values, setValues] = useState(0);
    const value = num =>{
        setValues(num)
    }
    const inputEvent =(event) =>{
        setValues(event.target,value)
    }
    return(
        <div>
            <h1>{values}</h1>
            <input type="text" placeholder={inputEvent}/>
            <div>
            <button onClick={inputEvent} value ="1">1</button>
            <button onClick={inputEvent} value ="1">2</button>
            <button onClick={inputEvent} value ="1">3</button>
            <button onClick={inputEvent} value ="1">4</button>
            <button onClick={inputEvent} value ="1">5</button>
            <button onClick={value} value ="1">6</button>
            <button>7</button>
            <button>8</button>
            <button>9</button>
            <button>0</button>
            </div>
        </div>
    );
}

export default App;
